function TodoListContainer() {
    return (
        <div className='TodoListCountainer'>
            <h1>Your Task</h1>
            <TodoCounter total={3} completed={2} />
            <TodoList TodoList>
                {defaultTodos.map((todo) => (
                    <TodoItem key={todo.text} text={todo.text} completed={todo.completed} />
                ))}
            </TodoList>
        </div>
    );
}
export {TodoListContainer};
